import React, { useEffect, useState } from 'react';

import classes from './finalists.module.css';
import Card from './UI/Card/Card';
import Item from './UI/Item/Item';

const Finalists = (props) => {
    // const catData = {
    //     Pre_Teen: [
    //         {
    //             name: "Thabo Test",
    //             age: "9",
    //             image: "img/testPic.jpg"
    //         },
    //         {
    //             name: "Dudu Test",
    //             age: "9",
    //             image: "img/testPic.jpg"
    //         }
    //     ],
    //     Jnr_Teen: [
    //         {
    //             name: "Thabo Test",
    //             age: "12",
    //             image: "img/testPic.jpg"
    //         },
    //         {
    //             name: "Dudu Test",
    //             age: "12",
    //             image: "img/testPic.jpg"
    //         }
    //     ],
    //     Teen: [
    //         {
    //             name: "Thabo Test",
    //             age: "16",
    //             image: "img/testPic.jpg"
    //         },
    //         {
    //             name: "Dudu Test",
    //             age: "16",
    //             image: "img/testPic.jpg"
    //         }
    //     ],
    //     Senior: [
    //         {
    //             name: "Thabo Test",
    //             age: "19",
    //             image: "img/testPic.jpg"
    //         },
    //         {
    //             name: "Dudu Test",
    //             age: "19",
    //             image: "img/testPic.jpg"
    //         }
    //     ],
    //     Miss_Drag: [
    //         {
    //             name: "Thabo Test",
    //             age: "29",
    //             image: "img/testPic.jpg"
    //         },
    //         {
    //             name: "Dudu Test",
    //             age: "29",
    //             image: "img/testPic.jpg"
    //         }
    //     ]
    // }

    // const [data, setData] = useState({
    //     loading: false,
    //     error: false
    // })

    const fetchPreTeen = props.data
        ? props.data.Pre_Teen.map((x) => (
            <Item
                key={x.id}
                id={x.id}
                name={x.name}
                age={x.age}
                image={x.image}
            />
        ))
        : "Loading"
    const fetchJnrTeen = props.data
        ? props.data.Jnr_Teen.map((x) => (
            <Item
                key={x.id}
                id={x.id}
                name={x.name}
                age={x.age}
                image={x.image}
            />
        ))
        : "Loading"
    const fetchTeen = props.data
        ? props.data.Teen.map((x) => (
            <Item
                key={x.id}
                id={x.id}
                name={x.name}
                age={x.age}
                image={x.image}
            />
        ))
        : "Loading"
    const fetchSenior = props.data
        ? props.data.Senior.map((x) => (
            <Item
                key={x.id}
                id={x.id}
                name={x.name}
                age={x.age}
                image={x.image}
            />
        ))
        : "Loading"
    const fetchMissDrag = props.data
        ? props.data.Miss_Drag.map((x) => (
            <Item
                key={x.id}
                id={x.id}
                name={x.name}
                age={x.age}
                image={x.image}
            />
        ))
        : "Loading"


    return (
        <div id='finalists' className='text-center'>
            <div className='container'>
                <div className='section-title'>
                    <h2>Our Finalists</h2>
                    <div className={classes.cards}>
                        <div className={classes.card_column}>
                            <Card head={"Pre' Teen"}>
                                <ul>{fetchPreTeen}</ul>
                            </Card>
                            <Card head={"Jnr. Teen"}>
                                <ul>{fetchJnrTeen}</ul>
                            </Card>
                        </div>
                        <div className={classes.card_column}>
                            <Card head={"Teen"}>
                                <ul>{fetchTeen}</ul>
                            </Card>
                            <Card head={"Senior"}>
                                <ul>{fetchSenior}</ul>
                            </Card>
                        </div>
                        <div className={classes.card_column}>
                            <Card head={"Miss Drag"}>
                                <ul>{fetchMissDrag}</ul>
                            </Card>
                        </div>
                    </div>

                    <div className={classes.cards_md}>
                        <div className={classes.card_column}>
                            <Card head={"Pre' Teen"}>
                                <ul>{fetchPreTeen}</ul>
                            </Card>
                            <Card head={"Jnr. Teen"}>
                                <ul>{fetchJnrTeen}</ul>
                            </Card>
                            <Card head={"Teen"}>
                                <ul>{fetchTeen}</ul>
                            </Card>
                        </div>
                        <div className={classes.card_column}>
                            <Card head={"Senior"}>
                                <ul>{fetchSenior}</ul>
                            </Card>
                            <Card head={"Miss Drag"}>
                                <ul>{fetchMissDrag}</ul>
                            </Card>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
};

export default Finalists;
